// eslint-disable-next-line
import React,{useState} from "react";
import axios from "axios";
function Contact() {

const [user,setUser]=useState({
  name:"",
  email:"",
  query:""
})

function handleChange(event){
  const newuser={...user}
  newuser[event.target.id]=event.target.value
  setUser(newuser)
  console.log(newuser);
}

function handleClick(){
  axios.post("https://localhost:9002/register",{
    name:user.name,
    email:user.email,
    query:user.query
  })
  .then(res=>{
    console.log(res.user)
  })
}

return (
    <div>
      <h1 className="text-center">Contact us</h1>
      <div className="form1 container">
        <div className="row">
          <div className="col-md-6 col-10 mx-auto">
            <form>
              <div class="form-group">
                <label>Name</label>
                <input
                  type="text"
                  id="name"
                  value={user.name}
                  class="form-control"
                  placeholder="Name"
                  onChange={handleChange}
                />
                <label for="exampleInputEmail1">Email address</label>
                <input
                  type="email"
                  class="form-control"
                  id="email"
                  value={user.email}
                  aria-describedby="emailHelp"
                  placeholder="Enter email"
                  onChange={handleChange}
                />
                <label>Your Query</label>
                <textarea
                  class="form-control"
                  id="query"
                  value={user.query}
                  cols="100"
                  rows="5"
                  placeholder="Query"
                  onChange={handleChange}
                ></textarea>
              </div>
              <button type="submit" class="btn btn-primary last" onClick={handleClick}>
                Submit
              </button>
            </form>
          </div>
        </div>
        <footer className="foot text-center">
          <p>Â© Copyright 2022 Clubs United</p>
          <p>
            Made with <i class="fa-solid fa-heart"></i> by Gaurav Ahuja
          </p>
        </footer>
      </div>
    </div>
  );
}
export default Contact;
